INSERT INTO `oc_information_description` VALUES (13,4,'Comissão de formatura','&lt;p style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Sobre a comissão de formatura. Os integrantes de uma comissão de\r\nformatura são escolhidos pela sua sala de aula, devem ser alunos estudantes e\r\nmatriculados em uma instituição de ensino. São as pessoas responsáveis para desenvolver as ações voltadas para a conclusão da sua formação. Pode ser composta por 1\r\npessoa e atingir números superiores à 45 integrantes.Varia de acordo com os números de cursos e salas\r\nenvolvidas.&lt;/span&gt;&lt;br&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A &lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;OUROAF &lt;/span&gt;&lt;/span&gt;auxilia a sua comissão a atingir\r\nseus objetivos.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Levamos para seus familiares e\r\nformandos&amp;nbsp; um produto exclusivo,&amp;nbsp; que aumenta ainda mais a exclusividade desse\r\nmomento tão importante na vida de todos os envolvidos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;a href=&quot;http://ouroaf.homolog.lojavirtual.digital/index.php?route=information/contact&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 0);&quot;&gt;Solicite um profissional para atende-lo.&lt;/a&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;br&gt;&lt;span style=&quot;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;mso-hansi-font-family:Calibri;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;\r\ncolor:black;mso-fareast-language:PT-BR&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;h2&gt;&lt;span style=&quot;color: black;&quot;&gt;Representante de grupo&lt;/span&gt;&lt;/h2&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;color: black;&quot;&gt;Quando não existindo a comissão de\r\nformatura, o representante de grupo se torna a pessoa responsável para levar\r\nas informações para seus companheiros de curso.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;a href=&quot;http://ouroaf.homolog.lojavirtual.digital/index.php?route=information/contact&quot; target=&quot;_blank&quot;&gt;Solicite um profissional para atende-lo.&lt;/a&gt;&lt;span style=&quot;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;mso-hansi-font-family:Calibri;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;\r\ncolor:black;mso-fareast-language:PT-BR&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;br&gt;&lt;br&gt;','Comissão','',''),(4,4,'Quem somos','&lt;hr&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: 1;&quot;&gt;&lt;img src=&quot;http://ouroaf.com/image/catalog/logo1.png&quot; style=&quot;width: 354.5px; height: 160.411px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Dos ourives, um oficio passado de geração em geração, exigente e detalhista que se aprimorou ao longo dos anos. A matéria prima mais pura que existe o ouro, o ateliê fazendo com que o sonho da exclusividade seja ainda mais explícito, não podia faltar toda a eficiência da fábrica, para completar esse processo.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Possuímos uma metodologia de trabalho exclusivo, atendemos grandes e pequenos grupos de pessoas. Geramos resultado em um universo magnifico e inovador. Possuímos as melhores gamas de possibilidades, que geram resultado a curto prazo, fazendo com que o sonho da formatura fique cada vez mais próximo para todos.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Com muito amor e exclusividade pensamos e desenvolvemos as nossas peças. Sempre levando para nosso cliente a excelência.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Conhecimento jovem, expertise comercial, praticidade e profissionalismo são partes permanentes em nossos processos.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;a href=&quot;http://ouroaf.homolog.lojavirtual.digital/index.php?route=information/contact&quot; target=&quot;_blank&quot;&gt;Conheça nosso trabalho.&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;&lt;br&gt;&lt;/div&gt;\r\n&lt;br&gt;&lt;br&gt;','Quem somos','',''),(5,4,'Termos e Condições','&lt;h2&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Garantia&lt;/span&gt;&lt;/h2&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A Garantia, certifica a autenticidade dos melhores materiais preciosos utilizados na confecção de sua joia, dando Garantia Vitalícia no Ouro.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A Garantia OuroAF é válida por 1 (um) ano* e cobre eventuais defeitos que se refiram a aspectos técnicos de fabricação e/ou dos materiais envolvidos. Excluem-se da garantia avarias decorrentes de quedas, uso inadequado, acidentes de qualquer natureza e contato com agentes químicos que possam causar danos aos materiais de sua joia. Na impossibilidade de reparar a peça dentro das condições de garantia, outra igual ou similar de mesmo valor será fornecida sem qualquer acréscimo.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Segundo a&amp;nbsp;&lt;span style=&quot;font-weight: bold;&quot;&gt;Garantia Vitalícia OUROAF&lt;/span&gt;&amp;nbsp;sempre que houver a necessidade da realização de um serviço que envolva custos, como em casos em que é necessário o acréscimo de material para ajuste de sua joia, o serviço será realizado somente mediante sua prévia autorização do orçamento.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 0);&quot;&gt;Haverá perda da garantia para o caso de conserto em estabelecimento comercial.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Poderá haver custo no caso de reposição de peças (pedras, bateria, pulseira, fecho, elos, etc.);&lt;/span&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;h2 style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Troca ou devolução&lt;/span&gt;&lt;/h2&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;O prazo para solicitação de troca ou devolução é de 30 dias corridos a contar da data de recebimento do pedido, com exceção de produtos promocionais que podem ser trocados em até 7 dias corridos a contar da data de recebimento do pedido. Entrar em contato com o nosso Serviço de Atendimento ao Cliente: sac@ouroaf.com. Nosso horário de atendimento é de segunda à sexta-feira das&amp;nbsp;10:00 às 19:00 horas&amp;nbsp;(exceto feriados).&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;As condições para a troca/devolução são:&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A peça deve estar na embalagem original, em perfeito estado e sem vestígios de uso;&lt;br&gt;&lt;/span&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A joia deve estar acompanhada do Cupom Fiscal e ou Certificado de Garantia OuroAF, contendo o número do Cupom Fiscal;&lt;br&gt;&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A troca se fará por outra peça de mesmo valor (à escolha do cliente), como parte do pagamento de outra peça de valor superior ao da peça trocada ou por um cupom, que pode variar de acordo com as promoções e pode não ser cumulativo;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Após o contato com o nosso Serviço de Atendimento ao Cliente basta enviar o produto na embalagem original em uma agência &amp;nbsp;dos Correios. A partir da confirmação do recebimento do volume será feita a liberação do novo produto ou cupom de troca. &lt;a href=&quot;http://m.correios.com.br/movel/agencias.do&quot; target=&quot;_blank&quot;&gt;Confira aqui&lt;/a&gt; a agência dos Correios mais próxima de você.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;IMPORTANTE:&lt;/span&gt; Em qualquer tempo não é permitida a troca de joias feitas sob encomenda ou joias que tenham sido alvo de reformas e modificações. O valor da peça devolvida, que será amortizado em uma nova peça, está sujeito a mudanças baseadas na cotação do ouro no dia da troca.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;IMPORTANTE:&lt;/span&gt; Antes de receber o novo produto, cupom de desconto ou estorno, o item trocado ou devolvido precisa chegar a nossa Assistência Técnica, onde será feito um processo de qualidade que pode levar até 20 dias úteis para ser concluído. Caso a escolha seja por outro produto, será calculado o novo prazo de entrega.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Caso a assistência técnica entenda que o produto devolvido não compreende os critérios pontuados acima, o site fica dispensado de aceitar a devolução ou fazer a troca. A OuroAF reenviará o produto ao cliente sem consulta prévia, acompanhado da justificativa do motivo da recusa. &amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;h2&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Cancelamento&lt;/span&gt;&lt;/h2&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Nos casos de cancelamento de compras realizadas através de cartão de crédito, é necessário entrar em contato com o nosso Serviço de Atendimento ao Cliente no e-mail sac@ouroaf.com solicitando o cancelamento imediato do pedido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;O cancelamento da compra pode ser feito dentro do prazo de até 7 dias corridos após o recebimento do pedido.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Nosso horário de atendimento é de segunda a sexta-feira das 10:00 às 19:00 horas (feriados).&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;br&gt;&lt;br&gt;','Termos e Condições','',''),(6,4,'Informações de Entrega','&lt;p style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;A inclusão de um produto no &quot;carrinho&quot; não garante sua reserva. O produto somente estará reservado ao cliente após a finalização do pedido e aprovação pela operadora do cartão.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Após o fechamento do pedido será enviado uma mensagem para seu e-mail informando o tempo estimado de entrega.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;O recebimento do seu pedido poderá ser feito por porteiros, secretárias, familiares ou qualquer responsável, mediante assinatura do comprovante de entrega e apresentação de documento.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Nosso horário de atendimento é de segunda a sexta-feira das 10:00 às 19:00 horas&amp;nbsp;( feriados).&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;IMPORTANTE:&amp;nbsp;&lt;/span&gt;Independente da modalidade escolhida, o prazo de entrega da sua compra passa a ser considerado a partir da confirmação de pagamento pelas instituições financeiras.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;IMPORTANTE:&amp;nbsp;&lt;/span&gt;Regras de entrega não se aplicam aos clientes University, por favor solicitar informações no sac@ouroaf.com.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;IMPORTANTE:&amp;nbsp;&lt;/span&gt;Antes do fechamento do pedido é possível saber o prazo de entrega acessando o seu “carrinho” e informando o número do seu CEP no campo “Calcule o frete”.&lt;br&gt;Após fazer isso é só clicar no botão “Calcular” e será exibido o tempo estimado de entrega para o CEP informado – também irá constar o valor do frete a ser cobrado. O&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&amp;nbsp;prazo de entrega dos seus pedidos varia de acordo com o endereço informado para entrega.&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;br&gt;&lt;br&gt;','Informações de Entrega','','');
/*!40000 ALTER TABLE `oc_information_description` ENABLE KEYS */;
UNLOCK TABLES;

